from pybricks.hubs import PrimeHub
from pybricks.parameters import Axis, Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase
from pybricks.tools import multitask, run_task, wait

# Set up all devices.
prime_hub = PrimeHub(top_side=Axis.Z, front_side=Axis.X)
left = Motor(Port.A, Direction.COUNTERCLOCKWISE)
right = Motor(Port.B, Direction.CLOCKWISE)
robot = DriveBase(left, right, 88, 97)
right_motor = Motor(Port.F, Direction.CLOCKWISE)
left_motor = Motor(Port.E, Direction.CLOCKWISE)

async def subtask():
    await wait(1500)
    await right_motor.run_angle(500, 245)

async def slowTurn():
    await wait(1)
    robot.use_gyro(True)
    robot.settings(turn_rate=150)
    robot.settings(turn_acceleration=200)

async def mediumSpeed():
    await wait(1)
    robot.use_gyro(True)
    robot.settings(straight_speed=400)
    robot.settings(straight_acceleration=100)
    robot.settings(turn_rate=150)
    robot.settings(turn_acceleration=750)

async def fastSpeed():
    await wait(1)
    robot.use_gyro(True)
    robot.settings(straight_speed=400)
    robot.settings(straight_acceleration=1000)

async def main():
    await mediumSpeed()
    await multitask(robot.straight(-420), right_motor.run_angle(500, 230), left_motor.run_angle(500, -400))
    await robot.turn(105)
    await multitask(robot.curve(-4000, -9), subtask())
    await robot.turn(-115)
    await wait(500)
    await robot.straight(65)
    await right_motor.run_angle(500, -60)
    await robot.straight(-65)
    await right_motor.run_angle(500, -180)
    await robot.straight(-835)
    await left_motor.run_angle(500, -300)
    await left_motor.run_angle(100, -140)
    await left_motor.run_angle(300, 440)
    await robot.straight(-120)
    await robot.curve(-800, 22)
    await slowTurn()
    await robot.turn(-60)
    await robot.curve(-800, -47)


run_task(main())